import { creatingContext } from "../MainContext"
import '../MainContext.css'
function ComA(params) {
    const contexting=useContext(creatingContext)
    console.log(contexting)
    return<div className="acom">
       {
        contexting.val.a.map((item,i)=>{
            return<h2 key={i}>{item}</h2>
        })
       }
       <button onClick={()=>{contexting.creatingnewValue('hii')}}>add</button>
    </div>
}
export default ComA
